        internal void Uncompress(string Hexa)
        {
            Reader br = new Reader(Hexa.HexaToBytes());

            Console.WriteLine($"LastUpdate {br.ReadInt32()}");
            Console.WriteLine($"Unknown int {br.ReadInt32()}");
            Console.WriteLine($"timestamp {br.ReadInt32()}");

            Console.WriteLine($"UserID {br.ReadInt64()}");
            Console.WriteLine($"ShieldDuration {br.ReadInt32()}");
            Console.WriteLine($"GuardDuration {br.ReadInt32()}");
            Console.WriteLine($"PersonalGuardDuration {br.ReadInt32()}");

            Console.WriteLine($"Compressed {br.ReadBoolean()}");
            Console.WriteLine($"Home {br.ReadZlibStream()}");
            Console.WriteLine($"Compressed {br.ReadBoolean()}");
            Console.WriteLine($"Event {br.ReadZlibStream()}");
            Console.WriteLine($"Compressed {br.ReadBoolean()}");
            Console.WriteLine($"Config {br.ReadZlibStream()}");

            Console.WriteLine($"UserID {br.ReadInt64()}");
            Console.WriteLine($"UserID {br.ReadInt64()}");
            var data = br.ReadFully();
            Console.WriteLine(BitConverter.ToString(data).Replace("-", ""));
            Console.WriteLine(Encoding.UTF8.GetString(data));
        }

